#include<stdio.h>
#include<stdlib.h>
typedef struct {
	int ii;
	int ss;
}DNA;
int main(){
	int a,b,c,i,j,k;
	int sum=0;
	char dna[100][100];

	scanf("%d",&a);
	//printf("\n");
	while(a>0){
		scanf("%d %d",&b,&c);
		DNA D[100];
		for(i=0;i<c;i++){
			scanf("%s",dna[i]);
			sum=0;
			for(j=0;j<b;j++){
				for(k=j+1;k<b;k++){
					if(dna[i][j]>dna[i][k]){
						sum++;
					}
				}

			}
			D[i].ii=i;
			D[i].ss=sum;
	//	printf("ii%d\n",D[i].ii);
		}

		int temp;
		for(j=0;j<c;j++){
			//printf("ss%d\n",D[j].ss);
			for(k=0;k<j;k++){
			//	printf("ss%d\n",D[k].ss);
				if(D[k].ss>D[j].ss){
				//	printf("A%d<<<<%d\n",D[j].ss,D[k].ss);
					temp=D[k].ii;
					D[k].ii=D[j].ii;
					D[j].ii=temp;
					temp=D[k].ss;
					D[k].ss=D[j].ss;
					D[j].ss=temp;
				//	printf("A%d>>>>>%d\n",D[j].ss,D[k].ss);
					}
				}
			}
		for(i=0;i<c;i++){
//	printf("ss:%d\n",D[i].ss);
		//	printf("%d",i);
			printf("%s\n",dna[D[i].ii]);
		}
		a--;
		if(a>0)printf("\n");
	}

}

